I use powershell and to help anyone coming to this thread later, I ran this command to get the environment strings Raj mentioned:  	docker ps | 
		% { $_ -Replace '\s\s+',',' } | 
		ConvertFrom-Csv | 
		Select-Object -Property *, @{
			Name="Environment"; 
			Expression = {
				docker inspect $_."CONTAINER ID" | 
				convertfrom-json | 
				% { 
					$hash 	= @{}; 
					foreach ($line in $_.Config.Env)
					{
						$tokens = $line -split '=',2
						$hash."$($tokens[0])" = $tokens[1]						
					}
					[PSCustomObject]$hash
				}
			}
		}

